import React from 'react';

function App() {
  return (
  <div className="App" >
    <div className="mx-8 text-center">
    <img className="mt-24 h-5 m-auto" src="./images/logo.svg" alt="Logo"/>
    <h1 className="mt-16 font-thin text-2xl">We are launching <span className="text-blue-dark font-bold">soon!</span></h1>
    </div>
  </div>
  );
}

export default App;
